import React from 'react';
import { useState } from 'react';

function AddProductPanel({onSubmit}) {
    const [formData, setFormData] = useState({
        name: '',
        description: '',
        category: '',
        image_url: '',
        rate: '',
        price:''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(formData);
    };

    return (
            <form onSubmit={handleSubmit}>
              <div class="form-group">
                <label for="titleInput">Product Title</label>
                <input class="form-control" id="titleInput" placeholder="title.." name="name" value={formData.name} onChange={handleChange} ></input>
              </div>
              <div class="form-group">
                <label for="titleInput">Image URL</label>
                <input class="form-control" id="titleInput" placeholder="url..." onChange={handleChange}></input>    
              </div>
              <div class="form-group">
                <label for="descriptionInput">Description</label>
                <textarea class="form-control" id="descriptionInput" placeholder="product is..."rows="3" onChange={handleChange}></textarea>
              </div>
              <div class="form-group">
                <label for="categoryInput">Category</label>
                <input class="form-control" id="categoryInput" placeholder="category" onChange={handleChange}></input>    
              </div>
              <div class="form-group">
                <label for="priceInput">Price</label>
                <input class="form-control" id="priceInput" placeholder="0.0" onChange={handleChange}></input>    
              </div>
              <div class="form-group">
                <label for="rateInput">Rate</label>
                <input class="form-control" id="rateInput" placeholder="0.0" onChange={handleChange}></input>    
              </div>
      </form>
  );
}

export default AddProductPanel;
